import React, { Component } from 'react';
import Viewer from './Viewer.js';
import './App.css';
import {
  Switch,
  Route
} from "react-router-dom";

class App extends Component {
  render() {
    return(
      <Switch>
        <Route path="/:slug">    
          <Viewer />
        </Route>

      </Switch>
      )
  }
}
export default App;
